import React, { Component } from 'react'; // import the React library
import './index.css';

const Title = (props) => {
    return (
        <div>
            <ul>
                <li>Hardcode Item 1</li>
                <li>Hardcode Item 2</li>
                <li>Hardcode Item 3</li>
            </ul>
        </div>
    )
}

export default Title;
